import React, { Component } from "react";
import '../../css/noticias-login.css'

class Noticias extends Component {

    render() {
        return (
            <div>
                <div className="noticia-login">
                    <span>Hola</span>
                </div>
            </div>
        )
    };
}
export default Noticias;
